import React from 'react'
import ReactFlow, { Controls, Background } from 'reactflow';
import 'reactflow/dist/style.css';
function Demo() {
    const nodes = [
        {
            id: '1', // required
            position: { x: 0, y: 0 }, // required
        },
    ];


    return (
        <>
            <div style={{ height: '100%' }}>
                <ReactFlow nodes={nodes}>
                    <Background />
                    <Controls />
                </ReactFlow>
            </div>
        </>
    )
}
export default Demo;
